import React, { Component } from "react";
import { connect } from "react-redux";
import * as system from "../actions/system";

class Footer extends Component {
  goBack() {}
  render() {
    return (
      <div className="footer">
        <footer class="page-footer">
          <div class="row">
            <div class="col">
              <button
                class="btn secondary"
                onClick={() => this.props.setModelType()}
              >
                add member
              </button>
            </div>
            <div class="col">
              <button class="btn " onClick={() => this.props.setModelType()}>
                system
              </button>
            </div>
            <div class="col">
              <button class="btn" onClick={() => this.props.setModelType()}>
                udemy
              </button>
            </div>
            <div class="col" onClick={() => this.props.setModelType()}>
              <button class="btn ">profile</button>
            </div>
          </div>
        </footer>
      </div>
    );
  }
}

Footer.propTypes = {};

function mapDispatchToProps(dispatch) {
  return {
    setModelType: data => dispatch(system.setModelType(data))
  };
}

function mapStateToProps(state) {
  return {
    profile: state.user.profile
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Footer);
